import UserProfileCss from "./UserProfile.module.css"

function UserProfile(props) {
    return (
        <div className={UserProfileCss.card}>
            <h2>{props.firstName}</h2>
            <span>{props.lastName}</span>
            <span>{props.age}</span>
        </div>
    )
}
export default UserProfile
